import React from "react";
import EmpData from "./EmpData";
import "./Emp.css";

const Emp = () => {
  console.log(EmpData);
  return (
    <>
      <div className="table-data">
        {EmpData.map((elem) => {
          let { id, fname, lname, age, job, salary } = elem;
          return <table>
            <h1>{id}</h1>
          </table>;
        })}
      </div>
    </>
  );
};

export default Emp;
